import React from "react";

const recipes = [
  { id: 1, name: "Chocolate Cake", image: "https://source.unsplash.com/300x200/?cake" },
  { id: 2, name: "Pasta Alfredo", image: "https://source.unsplash.com/300x200/?pasta" },
  { id: 3, name: "Grilled Chicken", image: "https://source.unsplash.com/300x200/?chicken" },
  { id: 4, name: "Fruit Salad", image: "https://source.unsplash.com/300x200/?fruit" },
  { id: 5, name: "Sushi Rolls", image: "https://source.unsplash.com/300x200/?sushi" },
  { id: 6, name: "Tacos", image: "https://source.unsplash.com/300x200/?tacos" },
];

const HomePage = () => {
  return (
    <div className="min-h-screen bg-gray-100 p-6">
      <h1 className="text-3xl font-bold text-center mb-6">Recipe Gallery</h1>
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6 max-w-4xl mx-auto">
        {recipes.map((recipe) => (
          <div key={recipe.id} className="bg-white p-4 rounded-xl shadow-md text-center">
            <img
              src={recipe.image}
              alt={recipe.name}
              className="w-full h-40 object-cover rounded-lg"
            />
            <h2 className="mt-3 text-lg font-semibold">{recipe.name}</h2>
          </div>
        ))}
      </div>
    </div>
  );
};

export default HomePage;
